 // SPDX-License-Identifier: MIT
 pragma solidity ^0.8.0;

import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
// import 'github.com/OpenZeppelin/openzeppelin-contracts/contracts/token/ERC20/IERC20.sol';

/**
 * The PaymentProcessor contract does this and that...
 */
contract PaymentProcessor {

    address public schBursary;
    // uint  _amount;
    IERC20 public UJToken;

    event PaymentDone(
        address student_payer,
        uint amount,
        uint paymentId,
        uint date
    );

  constructor(address bursaryAddress, address UJTokenAddress) {
    schBursary = bursaryAddress;
    UJToken = IERC20(UJTokenAddress);

  }



  function pay(uint _amount, uint _paymentId) external payable{
    UJToken.transferFrom(msg.sender, schBursary, _amount);
    emit PaymentDone(msg.sender, _amount, _paymentId, block.timestamp);
  }

}
